import React from 'react';

export default function Join() {
  return (
    <div className="table">
      <h2>Join us!</h2>
      <input placeholder="E-mail" type="email" />
      <input placeholder="Login" />
      <input placeholder="Password" type="password" />
      <button>Proceed</button>
    </div>
  );
}
